import React from 'react';
import './App.css';
import AppTitle from '../AppTitle'
import AppSearch from '../app-search-panel'
import AppToDoList from '../AppToDoList'
import AddPanel from '../app-add-panel'
import Tabs from  '../app-tabs'
// все данные храняться здесь - ToDoList перенести сюда и переделать на пропсы


function App() {
  return (
      <div className='App padding justify-content-center container'>
        <div className="card card-body">
          <AppTitle />
          <AddPanel />
          <AppSearch />
          <Tabs />
          <AppToDoList />
        </div>
      </div>
  );
}


export default App;
